var clickedScrollPos = 0;
var discJustClicked = false;
var selectedDisc;
var disContBackTemp = $("<div class='disc-back-to-content'><a href='#' onclick='backToContent();return false;' style='color:blue'>Back to Content</a></div>");
function disclaimerJump(locat){
	openDisclaimerAccordian()
    clickedScrollPos = $(window).scrollTop();
	setBackToContentLocation(locat)
	discJustClicked = true;
	return false;
}
function backToContent(){
	$('html, body').animate({
		scrollTop: clickedScrollPos + 'px'
	}, 1500 );
}

function setBackToContentLocation(btc){
	var discP = btc.hash.substr(1);
	$('html, body').animate({
		scrollTop: $("#" + discP).offset().top - 50 + 'px'
	}, 1500, function () {
		window.location.hash = discP;
	});
	selectedDisc = $("#" +discP+ "-content")
	$("#" +discP+ "-content").append(disContBackTemp)
	$("#" +discP+ "-content").addClass("disc-selected")
	$(".disc-back-to-content").show()
}
function openDisclaimerAccordian(){
	var discButton = $("#footer-section-disclosure").find(":button")
	if($(discButton).hasClass("collapsed")){
		discButton.click()
	}
}

window.addEventListener("load", addDiscLinks);
function addDiscLinks(){
	$('a[name="disclaimer-sup"]').attr("onclick","return disclaimerJump(this)")
}

window.addEventListener("scroll", checkBTCscreen);
function checkBTCscreen(){
    if($('.disc-back-to-content').length) {
	var isElementInView = Utils.isElementInView($('.disc-back-to-content'), false);
	if (isElementInView) {
		discJustClicked = false;
	}
	else{
		if(!discJustClicked){
			$(".disc-back-to-content").hide()
			$(selectedDisc).removeClass("disc-selected")
		}
	}
    }
}

function isScrolledIntoView(elem){
    var docViewTop = $(window).scrollTop();
    var docViewBottom = docViewTop + $(window).height();

    var elemTop = $(elem).offset().top;
    var elemBottom = elemTop + $(elem).height();

    return ((elemBottom <= docViewBottom) && (elemTop >= docViewTop));
}
function Utils() {

}

Utils.prototype = {
    constructor: Utils,
    isElementInView: function (element, fullyInView) {
        var pageTop = $(window).scrollTop();
        var pageBottom = pageTop + $(window).height();
        var elementTop = $(element).offset().top;
        var elementBottom = elementTop + $(element).height();

        if (fullyInView === true) {
            return ((pageTop < elementTop) && (pageBottom > elementBottom));
        } else {
            return ((elementTop <= pageBottom) && (elementBottom >= pageTop));
        }
    }
};

var Utils = new Utils();






