let individualDynamicRateContainers = document.querySelectorAll('.js-individual-dynamic-rate')
let exampleDemoJsonContainer = document.querySelector('.js-example-json-demo-container')

individualDynamicRateContainers.forEach(individualDynamicRateContainer => {
    setIndividualDynamicRate(individualDynamicRateContainer)
  });

function setIndividualDynamicRate(rateElement){
    let rateElementUrl = rateElement.getAttribute('data-rate-path')
    let rateElementKeys = rateElement.getAttribute('data-rate-key')
    let rateElementTrimFront = rateElement.getAttribute('data-trim-front')

    fetchWithTimeout(rateElementUrl, {}, 10000)
        .then(response => response.json())
        .then(data => {
            handleData(data)
            rateElement.setAttribute("data-component-loaded", "true")
        })
        .catch(error => {
            console.error('Individual Dynamic Rate Error:', error)
            rateElement.innerText = 'error'
            rateElement.classList.remove('individual-rate-placeholder')
            rateElement.setAttribute("data-component-loaded", "false")
        });

    function handleData(rateDataFetched) {
        try{

            let rateDataMemory = jsonPath(rateDataFetched, rateElementKeys)
            let frontTrimmedRate = rateDataMemory.toString().slice(rateElementTrimFront)
            rateElement.innerText = frontTrimmedRate
            rateElement.classList.remove('individual-rate-placeholder')

            if (rateDataMemory === false) {
                throw 'no rate data returned, invalid key'
            }

        } catch(err){
            console.error(err)
            rateData = 'error'
            rateElement.innerText = rateData
            rateElement.classList.remove('individual-rate-placeholder')
        }

        let demoUpdateJson = rateElement.getAttribute('data-demo')

        if (demoUpdateJson !== null) {
            exampleDemoJsonContainer.innerText = JSON.stringify(rateDataFetched, null, 2)
        } 
    }
}




