    // get all of the lottie animations that should be played when visible
    const lottieAnimations = document.querySelectorAll(".js-lottie-animation");
    const lottieAnimationsAutoPlay = document.querySelectorAll(".lottie");
  
    // configuration for the observer
    const configLottieAnimation = {
      root: null,
      threshold: [0.1, 0.1],
    };
  
    // create the observer
    let observer = new IntersectionObserver(function (entries, self) {
      entries.forEach((entry) => {
        if (entry.isIntersecting === true) {
          function convertBool(str) {
            if (str.toLowerCase() === ("true" || true)) return true
            if (str.toLowerCase() === ("false" || false)) return false
            return false
          }

          const dataAnimationLoaded = entry.target.getAttribute("data-loaded")
          const lottieDataPath = entry.target.getAttribute("data-animation-path");
          const lottieDataName = entry.target.getAttribute("data-name");
          const lottieDataLoop = convertBool(entry.target.getAttribute("data-anim-loop"));
          const lottieDataAutoPlay = convertBool(entry.target.getAttribute("data-anim-autoplay"));
          
          if (dataAnimationLoaded !== "true") {
            let lottieAnimationObject = lottie.loadAnimation({
              container: entry.target, // Required
              path: lottieDataPath, // Required
              renderer: 'svg', // Required
              loop: lottieDataLoop, // Optional
              autoplay: lottieDataAutoPlay, // Optional
              name: lottieDataName
            })
  
            lottieAnimationObject.addEventListener('data_ready', function() {
              console.log('animation data fully loaded for', lottieDataPath)
              playLottieAnimationOnVisible(entry.target);
            })
            
            entry.target.setAttribute("data-loaded", "true")
        } else {
          playLottieAnimationOnVisible(entry.target);
        }
        
        }
      });
    }, configLottieAnimation);
  
    // observe each of the lottie animations
    lottieAnimations.forEach((lottieAnimation) => observer.observe(lottieAnimation));
  
    // ressize lottie animations if the window size changes
    if (lottieAnimations.length > 0) {
      window.onresize = function () {
        lottie.resize();
      };
    }
    
    // plays the animation, invoked by the intersection observer
    function playLottieAnimationOnVisible(divItem) {
      let lottieDataName = divItem.getAttribute("data-name");
      let lottieClassList = divItem.classList.toString();
      let dataPlayOnce = divItem.getAttribute("data-play-once");
      let animationHasPlayed = divItem.getAttribute("animation-has-played");
      let prefersReducedMotion = window.matchMedia("(prefers-reduced-motion: reduce)").matches;
      let prefersReducedMotionByPassQueryString = window.location.search.includes("unset-prefers-reduced-motion")
      let prefersReducedMotionByPassBodyClass = document.querySelector("body").classList.contains("unset-prefers-reduced-motion")

  
      // check to see if animation should only play once, and if so, if it has already been played
      if ((dataPlayOnce !== "true" || (animationHasPlayed === null && dataPlayOnce === "true")) && lottieClassList.includes("lottie-play-on-visible") === true) {
        if (prefersReducedMotion && !prefersReducedMotionByPassQueryString & !prefersReducedMotionByPassBodyClass) {
          lottieLoadAnimation(divItem)
          return;
        }
        lottie.stop(lottieDataName)
        
        // this is a function called from the homepagedemo/vertical tab component
        // it will reset the tab height to be correct at mobile when it loads
        setVertAndHompageTabHeight()
        lottie.play(lottieDataName);
  
        // if the animation should only be played one time then set a data attribute so it will not get played again
        if (dataPlayOnce === "true") {
          divItem.setAttribute("animation-has-played", "true");
        }
      }
    }
  
    // call this function to play the animation on click or after another event
    function playAnimationOnEvent(componentID) {
      let animationContainer = document.querySelector(`#${componentID}`);
      let lottieDataName = animationContainer.getAttribute("data-name");
      lottie.goToAndStop(0, 0, lottieDataName)
      lottie.play(lottieDataName);
    }
  
    function lottieLoadAnimation(divItem) {
      let lottieDataName = divItem.getAttribute("data-name");
      lottie.goToAndStop(99, lottieDataName);
    }
// get all of the images that should be lazy loaded
const lazyImages = document.querySelectorAll(".js-lazy-image");

// configuration for the observer
const config = {
	root: null,
	rootMargin: "100px"
};

// create the observer
let imageObserver = new IntersectionObserver(function(entries, self) {
	entries.forEach(entry => {
		if (entry.isIntersecting === true) {
			const lazyImageElement = entry.target;
			lazyImageElement.src = lazyImageElement.dataset.src;
			lazyImageElement.classList.remove("js-lazy-image");
			imageObserver.unobserve(lazyImageElement);
		}
	});
}, config);

// observe each of the images
lazyImages.forEach(lazyImage => {
	imageObserver.observe(lazyImage);
});

