// find all of the link elements that need a mortgage referrer on the page
const mloReferrerIdRequestButtons = document.querySelectorAll(".js-mortgage-loan-officer-id a");
mloReferrerIdRequestButtons.forEach((mloReferrerIdRequestButton) => setMortgageLoanOfficerQueryParam(mloReferrerIdRequestButton));

// find all of the link elements that need a mortgage phone number on the page
const mloPhoneRequestButtons = document.querySelectorAll(".js-mortgage-loan-officer-phone a");
mloPhoneRequestButtons.forEach((mloPhoneRequestButton) => setMortgageLoanOfficerPhoneNumber(mloPhoneRequestButton));

function getLocalStorageObject(key) {
  // get the local storage value
  return JSON.parse(window.localStorage.getItem(key));
}

function setMortgageLoanOfficerQueryParam(mloElementRequestingParameter) {
  const localStorage = getLocalStorageObject("profile");
  if (localStorage === null) return;
  if (localStorage["email"] === (undefined || null || "")) return;

  // get the current url and test to see if the url is relative or absolute
  const baseUrl = new URL(`${window.location.protocol}//${window.location.hostname}/`);
  const existingUrlString = mloElementRequestingParameter.getAttribute("href");
  const absoluteUrlRegex = new RegExp("((http|https|ftp)://)");
  const absoluteUrlTest = absoluteUrlRegex.test(existingUrlString);

  let existingUrl;

  // add a base if the url is relative
  if (absoluteUrlTest) existingUrl = new URL(existingUrlString);
  if (!absoluteUrlTest) existingUrl = new URL(existingUrlString, baseUrl);

  // get current query parameters (to preserve other parameters that might have been set)
  const mloQueryParams = new URLSearchParams(existingUrl.search);

  // update the parameters and store the updated url in a new variable
  mloQueryParams.set("referrerID", localStorage["email"]);
  existingUrl.search = `?${mloQueryParams}`;
  const updatedUrl = existingUrl.toString();

  // set the new url on the button
  mloElementRequestingParameter.setAttribute("href", updatedUrl);

  // this line is just for demo purposes, to show that the url is being updated
  //mloElementRequestingParameter.innerText = updatedUrl;
}

function setMortgageLoanOfficerPhoneNumber(mloElementRequestingParameter) {
  const localStorage = getLocalStorageObject("profile");
  if (localStorage === null) return;
  if (localStorage["phone"] === (undefined || null || "")) return;

  const phoneNumber = localStorage["phone"];

  // set the new url and href value on the button
  mloElementRequestingParameter.setAttribute("href", `tel:${phoneNumber}`);
  mloElementRequestingParameter.innerText = phoneNumber;
}



function initLiveChatFeatures() {
    const truLiveChatFloatingButtonContainer = document.querySelector('.tru-floating--bottom-right')
    const truLiveChatFloatingButton = document.querySelector('.tru-floating-live-chat--button')

    // add skip to chat button
    function addSkipToChatButton() {
        const skipButtonContainer = document.querySelector(".skipcontent")
        if (skipButtonContainer && (document.querySelectorAll(".js-skip-to-chat").length === 0)) {
            const skiptoChatButton = `<a class="skip-main js-skip-to-chat" href="#tru-floating-live-chat--button">Skip to chat</a>`
            const skipChatContainer = document.createElement("div")
            skipChatContainer.innerHTML = skiptoChatButton
            skipButtonContainer.appendChild(skipChatContainer)
        }
    }

    function updateLiveChatAriaLabel() {
        truLiveChatFloatingButtonContainer.setAttribute("role", "complementary")
        truLiveChatFloatingButtonContainer.setAttribute("aria-label", "live chat")
    }

    function updateSecondaryNavStatus() {
        const secondaryNavBar = document.querySelector(".navbar-secondary__main-container")
        if (secondaryNavBar) {
            secondaryNavBar.classList.add("secondary-navbar--live-chat-loaded")
            truLiveChatFloatingButtonContainer.classList.add("live-chat--secondary-navbar-loaded")
        }
    }

    // if chat button has loaded then add skip to chat button
    if (truLiveChatFloatingButton) {
        addSkipToChatButton();
        updateLiveChatAriaLabel();
        updateSecondaryNavStatus();
    } else if (!truLiveChatFloatingButton) {
        // if chat button hasn't loaded, then watch for mutations
        const truLiveChatFloatingButtonContainerOptions = {
            childList: true,
            subtree: true
        }

        const truLiveChatObserver = new MutationObserver(truLiveChatCallBack);

        function truLiveChatCallBack(mutations) {
            for (let mutation of mutations) {
                if (mutation.type === 'childList') {
                    addSkipToChatButton();
                    updateLiveChatAriaLabel();
                    updateSecondaryNavStatus();
                }
            }
        }

        try {
            truLiveChatObserver.observe(truLiveChatFloatingButtonContainer, truLiveChatFloatingButtonContainerOptions);
        } catch (e) {
            console.log ("Unable to run initLiveChatFeatures:", e)
        }
    }
}

$(document).ready(function() {
    initLiveChatFeatures()
});
// tests to see if the param is present
function detectTabUtilRequest(parameter, queryStringParams) {
    const urlParams = new URLSearchParams(queryStringParams);
    const selectedParam = urlParams.has(parameter);
    if (selectedParam) return urlParams.get(parameter);
    return null
}

// clicks and opens the tab, scrolls element into view
function openTruistTab (paramValue) {
    const tabToSelectArray = paramValue.split("*");
    let tabToClick = tabToSelectArray[0]
    if (tabToClick.includes("!")) {
        let cssSelectorArray = tabToSelectArray[0].split("!")
        tabToClick = cssSelectorArray.join(" > ")
    }
    document.querySelector(`#${tabToClick}`).click();
    if (!tabToSelectArray[1]) return;
    const anchorId = `#${tabToSelectArray[1]}`
    const anchorElement = document.querySelector(anchorId);
    anchorElement.scrollIntoView({behavior: "smooth"});
    anchorElement.classList.add("js-tab-util-selected")
}

// goes to slick slide, scrolls element into view
function openTruistSlide (sliderId, slideNumber, anchorId) {
    $(sliderId).slick('slickGoTo', slideNumber);
    if (!anchorId) return;
    const anchorElement = document.querySelector(`#${anchorId}`)
    anchorElement.scrollIntoView({behavior: "smooth"});
    anchorElement.classList.add("js-tab-util-selected")
}

// sets up data for selecting slide
function findTruistSlide (paramValue) {
    const slideToSelectArray = paramValue.split("*");
    const sliderId = `#${slideToSelectArray[0]}`
    const slideNumber = slideToSelectArray[1]
    let anchorId
    if (!slideToSelectArray[2]) anchorId = null
    if (slideToSelectArray[2]) anchorId = slideToSelectArray[2]
    truWatchSlickInit(sliderId, slideNumber, anchorId)
}

// checks to see if slick has inited
function truWatchSlickInit (sliderId, slideNumber, anchorId) {
    const truMobileSlider = document.querySelector(sliderId)

    if (!truMobileSlider) {
        console.log("Slider ID does not exist on this page.")
        return;
    }

    const truMobileSliderOptions = {
        childList: true,
        subtree: true
    }

    const truMobileSliderObserver = new MutationObserver(truSlideFound);

    function truSlideFound(mutations) {
        for (let mutation of mutations) {
            if (mutation.type === 'childList') {
                if (mutation.addedNodes[0]) {
                    if (mutation.addedNodes[0].classList.value === "slick-dots"){
                    openTruistSlide(sliderId, slideNumber, anchorId)
                    return;
                    }
                }
            }
        }
    }

    truMobileSliderObserver.observe(truMobileSlider, truMobileSliderOptions);

    if (document.querySelector(`${sliderId} ul.slick-dots`)) {
        openTruistSlide(sliderId, slideNumber, anchorId)
        return;
    } 
}

// routes to the correct functions depending on the query string parameters
function selectTruistTabs(queryStringParams) {
    const tabToSelect = detectTabUtilRequest("tru-tab-select", queryStringParams)
    const slideToSelect = detectTabUtilRequest("tru-slide-select", queryStringParams)
    if (tabToSelect) {
        try {
            openTruistTab(tabToSelect)
        } catch(e){
            console.log("Tab selection failed:", e)
        }
    }

    if (slideToSelect) {
        try {
            findTruistSlide(slideToSelect)
            
        } catch(e){
            console.log("Tab selection failed:", e)
        }
    }
}

// sets buttons and links up for opening up the slides or tabs on the same page
function openTruistTabSamePage(element){
    const baseUrl = new URL(`${window.location.protocol}//${window.location.hostname}/`);
    const existingUrlString = element.getAttribute("data-tru-tab-open");
    const absoluteUrlRegex = new RegExp("((http|https|ftp)://)");
    const absoluteUrlTest = absoluteUrlRegex.test(existingUrlString);
  
    let existingUrl;
  
    // add a base if the url is relative
    if (absoluteUrlTest) existingUrl = new URL(existingUrlString);
    if (!absoluteUrlTest) existingUrl = new URL(existingUrlString, baseUrl);
  
    selectTruistTabs(existingUrl.search)
}

// sets event listener on buttons and links to open tabs or slides
function selectTruistTabsSamePage() {
    const samePageTabButtons = document.querySelectorAll(".js-tru-tab-open-tab-same-page a")
    samePageTabButtons.forEach((samePageTabButton) => {
        let href = samePageTabButton.getAttribute("href")
        samePageTabButton.setAttribute("data-tru-tab-open", href)
        samePageTabButton.removeAttribute("href")
        samePageTabButton.setAttribute("tabindex", "0")
        samePageTabButton.addEventListener("click", function() {
            openTruistTabSamePage(samePageTabButton)
        })

    });
}

