////////////////////
// Tab Selector Utility
////////////////////
// The tab selector utility will select a specific tab and scroll the content into view. It works for: Fill Tabs (Purple Tabs), Truist Tabs (Underline Tabs), Homepage Demo Tabs, Vertical Tabs
// The utility will fire when one or both of the following query string parameters are present:
// - tru-tab-select: used for all tabs (other than the mobile view of truist tabs)
// - tru-slide-select: used for the mobile view of truist tabs

////////////////////
// tru-tab-select
////////////////////
// tru-tab-select accepts two parameters in the form of a single string (with some specific formatting)
// - Example: ?tru-tab-select=slider-button-2-vertical-tab-component-73836239*vertical-tab-component-73836239
// - The first parameter is the ID of the tab button that you want to open: slider-button-2-vertical-tab-component-73836239
// - The second parameter is the ID of the container that you want to scroll into view: vertical-tab-component-73836239
// - Separate the two parameters with an asterisk: *
// - If you dont want the page to scroll after the tab is selected (e.g. linking from inside one tab to another tab) then you can omit the second ID
//     - Be sure to leave the asterisk at the end of the parameter, though
//     - Example: ?tru-tab-select=slider-button-2-vertical-tab-component-73836239*
// - In the event that the buttons ID is not directly on the clickable element you can also include ! to make more complex css selectors.
//     - ! will get turned into > (note: this is needed because > is an unsafe character for URLs) 
//     - For example youll need to use this functionality for the desktop version of fill tabs:
//     - Example: ?tru-tab-select=item-2--truisttabs-1576241947!a*nav-truisttabs-1576241947 
//     - The JS will turn the first parameter into: document.querySelector(item-2--truisttabs-1576241947 > a).click()

////////////////////
// tru-slide-select
//////////////////// 
// tru-slide-select is used to select a specific slide in the Slick carousel that gets initialized in the mobile view of the fill tabs (purple tabs)
// tru-slide-select accepts three parameters in the form of a single string (with some specific formatting)
// - Example: ?tru-slide-select=content-mobile-truisttabs-1576241947*1*nav-bar-mobile-truisttabs-1576241947
// - The first parameter is the ID that is used to initialize the Slick slider (you can find this by locating the div that has the class slick-initialized): content-mobile-truisttabs-1576241947
// - The second parameter is the tab that you want to open (note: the logic follows zero-based numbering, so 0 equals the first tab, 1 equals the second tab, etc.): 1
// - The third parameter is the ID of the container that you want to scroll into view: nav-bar-mobile-truisttabs-1576241947
// - If you dont want the page to scroll after the slide is selected (e.g. linking from inside one slide to another slide) then you can omit the third ID
//     - Be sure to leave the asterisk at the end of the parameter, though
//     - Example: ?tru-slide-select=content-mobile-truisttabs-1576241947*1*

////////////////////
// Using both utilities for fill tabs
////////////////////
// You can use the two pieces of functionality together for the fill tabs component 
// - Youll need to do this when linking from another page to a specific fill tab where you dont know what device the user is on
// - This is because the component is adaptive (rather than responsive) so we have to set the select tab in two places, hence the two query string parameters
// - Separate the two parameters with an ampersand (as you usually would with multiple query string parameters): &
//     - Order does not matter
// - Example: ?tru-slide-select=content-mobile-truisttabs-1576242047*1*nav-bar-mobile-truisttabs-1576241947&tru-tab-select=item-2--truisttabs-1576241947!a*nav-truisttabs-1576241947

////////////////////
// Authoring
////////////////////
// To author a component with these parameters, simply include them in the query string parameters field (without the question mark at the beginning)
// - Example: tru-slide-select=content-mobile-truisttabs-1576241947*1*nav-bar-mobile-truisttabs-1576241947
// - If you are linking to a tab on same page (like a button that links to another tab in the same set of tabs) include the following class: js-tru-tab-open-tab-same-page
//     - Either include the class by using the style policy or using the custom class filed in the component dialog
