function changePosterImage(status) {

    $(".videoHero-input-hidden-container").each(function () {
        var componentID, desktopPosterImage, mobilePosterImage, autoPlay;
        componentID = $(this).find(".componentClass").attr("value");
        desktopPosterImage = $(this).find(".desktopPosterClass").attr("value");
        mobilePosterImage = $(this).find(".mobilePosterClass").attr("value");
        autoPlay = ($(this).find(".autoPlayFlagclass").attr("value") == "autoplay");

        var componentInstance = document.getElementById(componentID);

        if(componentInstance === null){
            return;
        }

        if ($(window).width() <= 896) {
            if (mobilePosterImage !== undefined) {
                componentInstance.setAttribute("poster", mobilePosterImage);
            } else {
                componentInstance.removeAttribute("poster");
            }
        } else {
            if (desktopPosterImage !== undefined) {
                componentInstance.setAttribute("poster", desktopPosterImage);
            } else {
                componentInstance.removeAttribute("poster");
            }
        }

        /* Andhroid Devices fixed */

        var isAndroid = /android/i.test(navigator.userAgent.toLowerCase());
        if ($(window).width() <= 896) {
            isAndroid = /android/i.test(navigator.userAgent.toLowerCase());
            if (isAndroid) {
                if (mobilePosterImage !== undefined) {
                    componentInstance.removeAttribute("autoplay");
                }
            }
        }

        /* Full screen mode */
        if (!autoPlay && (status === "") && document.webkitIsFullScreen && document.fullScreen && document.mozFullScreen && document.webkitIsFullScreen) {
            componentInstance.load();
        }
        if (autoPlay || (status === "end")) { // How to load video without play
            componentInstance.removeAttribute("autoplay");
            videoSrc = componentInstance.currentSrc;
            componentInstance.src = "";
            componentInstance.src = videoSrc;
        }
    });
}

