function configureVideoElement(id) {
    var mediaID = $("#" + id + " Video").attr("id");
    var media = document.getElementById(mediaID);
    // Playing event

    if (media.autoplay == true) {
        $("#" + id + " .VideoComponentWrapper .toolbox-container").addClass("hide").removeClass("show");
        media.play();
    }

    var playpauseiconID = $("#customcontrolbutton-" + id).attr("id");
    var playpauseicon = document.getElementById(playpauseiconID);
    var iOS = /iPad|iPhone|iPod/.test(navigator.userAgent) && !window.MSStream;
    var navigatorAndroid = navigator.userAgent.match(/Android/i);

    if (iOS || navigatorAndroid) {
        media.pause();
        window.onscroll = function () {
            $(media).css("-webkit-transform", "translate3d(0, 0, 0)");
        };
    }

    $(playpauseicon).on("click", function () {
        if (media.paused) {
            $("#" + id + " .video-wrapper-play-pause .pauseButton-video").removeClass("hide").addClass("show");
            $("#" + id + " .video-wrapper-play-pause .playButton-video").removeClass("show").addClass("hide");
            media.play();
        } else {

            $("#" + id + " .video-wrapper-play-pause .playButton-video").removeClass("hide").addClass("show");
            $("#" + id + " .video-wrapper-play-pause .pauseButton-video").removeClass("show").addClass("hide");
            media.pause();
        }
    });

    if (media.paused) {
        $("#" + id + " .video-wrapper-play-pause .playButton-video").removeClass("hide").addClass("show");
    } else {
        $("#" + id + " .video-wrapper-play-pause .pauseButton-video").removeClass("hide").addClass("show");
    }

    $(media).on("click", function (event) {

        if ((!this.paused)) {
            event.preventDefault();
            $("#" + id + " .VideoComponentWrapper .toolbox-container").removeClass("hide").addClass("show");
            this.pause();

            $("#" + id + " .video-wrapper-play-pause .playButton-video").removeClass("hide").addClass("show");
            $("#" + id + " .video-wrapper-play-pause .pauseButton-video").removeClass("show").addClass("hide");

        } else {
            event.preventDefault();
            this.play();
            $("#" + id + " .VideoComponentWrapper .toolbox-container").removeClass("show").addClass("hide");

            $("#" + id + " .video-wrapper-play-pause .playButton-video").removeClass("show").addClass("hide");
            $("#" + id + " .video-wrapper-play-pause .pauseButton-video").removeClass("hide").addClass("show");

        }
    });

    $(media).on("play", function () {
        $("#" + id + " .video-wrapper-play-pause .pauseButton-video").show();
        $("#" + id + " .video-wrapper-play-pause .playButton-video").hide();
        $("#" + id + " .VideoComponentWrapper .toolbox-container").addClass("hide").removeClass("show");
    });

    // Pause event
    $(media).on("pause", function () {
        $("#" + id + " .video-wrapper-play-pause .playButton-video").show();
        $("#" + id + " .video-wrapper-play-pause .pauseButton-video").hide();
        $("#" + id + " .VideoComponentWrapper .toolbox-container").removeClass("hide").addClass("show");
    });

    //On Ended
    $(media).on("ended", function () {
        if (!this.paused)
            $("#" + id + " .VideoComponentWrapper .toolbox-container").removeClass("hide").addClass("show");
        this.pause();

        changePosterImage("end");
        $("#" + id + " .video-wrapper-play-pause .playButton-video").removeClass("hide").addClass("show");
        $("#" + id + " .video-wrapper-play-pause .pauseButton-video").removeClass("show").addClass("hide");
    });

    // Seeking event

    var isIE11 = !!navigator.userAgent.match(/Trident.*rv\:11\./) || window.navigator.userAgent.indexOf("Edge") > -1;

    if (window.navigator.userAgent.indexOf("Edge") > -1) {
        $(media).on("canplay canplaythrough", function () {
            if (!this.paused) {
                $("#" + id + " .VideoComponentWrapper .toolbox-container").addClass("hide").removeClass("show");
            }
        });
    }

    // Show/Hide transcript
    $("#" + id + " .VideoComponentWrapper .moreinfo").hide();
    var videoWrapperSelector = $("#" + id + " .VideoComponentWrapper .more");

    function showTranscript() {
        videoWrapperSelector.find(".showt").removeClass("show").addClass("hide");
        videoWrapperSelector.find(".hidet").removeClass("hide").addClass("show");
    }

    function hideTransript() {
        videoWrapperSelector.find(".showt").removeClass("hide").addClass("show");
        videoWrapperSelector.find(".hidet").removeClass("show").addClass("hide");
    }
    videoWrapperSelector.click(function (ev) {
        var t = ev.target
        $("#" + id + " .VideoComponentWrapper  .moreinfo").toggle(500, function () {
            $(t).html($(this).is(":visible") ? showTranscript() : hideTransript());
        });
        return false;
    });

    // Poster

    var isSafari = /^((?!chrome|android|iPhone|iPad).)*safari/i.test(navigator.userAgent);
    if (isSafari) {
        if (!playpauseicon) {
            $(media).click(function () {
                this.paused ? this.play() : this.pause();
            });
        }
    }
}
