function parseTags(tags) {
    var i;
    var tagString = "";
    var tagArray = tags.substring(1, tags.length - 1).split(",");
    for (i = 0; i < tagArray.length; i += 1) {
        if (tagString.length > 0) {
            tagString += " ";
        }
        tagString += "<span class='dll-listview-tags'>" + tagArray[i].split(":")[1] + "</span>";
    }
    return tagString;
}

function retreiveDLLCardData(url, pageLoad, Filters, Sorts) {
    var jsonData = [];
    url = url + "?cache=" + getDateTimeStamp() + "&firstLoad=" + pageLoad; // Needed for service to work on subsequent calls
    $.ajax({
        async: false,
        type: "GET",
        dataType: "JSON",
        url: url,
        data: {
            "FilterBy": Filters,
            "SortBy": Sorts
        },
        success: function (response) {
            jsonData = response.dynamicList;
        }
    });
    return jsonData;
}

function getDateTimeStamp() {
    var todayDate = new Date();
    var timestamp = todayDate.getMonth() + "-" + todayDate.getDate() + "-" + todayDate.getFullYear() + ":" + todayDate.getHours() + ":" + todayDate.getMinutes() + ":" + todayDate.getSeconds();
    return timestamp;
}

function renderComponent(componentID, pageLoad, Filters, Sort) {
    var dllComponentGlobalVariables;
    dllComponentGlobalVariables = DLLCollection[componentID];
    dllComponentGlobalVariables.DLLCardData = retreiveDLLCardData(dllComponentGlobalVariables.resourcePath, pageLoad, Filters, Sort);
    dllComponentGlobalVariables.cardIndex = 0;
    DLLCollection[componentID] = dllComponentGlobalVariables;

    if (dllComponentGlobalVariables.DLLCardData === null) {
        $("#DynamicListContents_" + componentID).html("<div class='dll-noresults-message' tabindex='0'>" + dllComponentGlobalVariables.noCardMessage + "</div>");
        return;
    }
    dllComponentGlobalVariables.totalCardsFetched = dllComponentGlobalVariables.DLLCardData.length;
    if (dllComponentGlobalVariables.totalCardsFetched <= 0) {
        $("#DynamicListContents_" + componentID).html("<div class='dll-noresults-message' tabindex='0'>" + dllComponentGlobalVariables.noCardMessage + "</div>");
        return;
    }
    var layoutContent = "";
    if (dllComponentGlobalVariables.totalCardsFetched > dllComponentGlobalVariables.itemsPerRow) {
        dllComponentGlobalVariables.itemsPerRow = dllComponentGlobalVariables.masterItemsPerRow;
    }

    dllComponentGlobalVariables.totalPages = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / dllComponentGlobalVariables.totalCardsPerLoad);

    if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
        $(".dllHeaderBar").addClass("hide-header-wrapper");
    }
    $("#DynamicListContents_" + componentID).html("");
    if (dllComponentGlobalVariables.contentNavigationOption === "carousel") { // display carousel layoutContent
        layoutContent = renderCarouselLayout(componentID);
        $("#DynamicListContents_" + componentID).append(layoutContent);
        $("#carousel-component-wrapper").carousel();
    }
    if (dllComponentGlobalVariables.contentNavigationOption === "pagination") { // display pagination layoutContent
        $("#DynamicListContents_" + componentID).html("<span aria-live='polite' role='heading' aria-level='2' class='sr-only'>Showing cards on page <span class='sr-only dll-current-page'>1</span></span>");
        layoutContent = renderPaginationLayout(componentID);
        $("#DynamicListContents_" + componentID).append(layoutContent);
        cardTemplateGeneration(dllComponentGlobalVariables);
        cardPagination(dllComponentGlobalVariables);
    }

    if (dllComponentGlobalVariables.contentNavigationOption === "loadmore") { // display load more layoutContent
        layoutContent = renderLoadMoreLayout(componentID);
        $("#DynamicListContents_" + componentID).append(layoutContent);
    }
    cardWidthAlign(componentID);
    portraitViewScript();
    return;

    if (dllComponentGlobalVariables.showPartialCard) {
        $(window).resize(function () {
            portraitViewScript();
        });

        $(document).ready(function () {
            portraitViewScript();
        });
    }
}

