function renderCarouselLayout(componentID) {

    var dllComponentGlobalVariables = DLLCollection[componentID];
    var slideCount = 0;
    var totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / dllComponentGlobalVariables.totalCardsPerLoad);
    var carouselIndicatorBars = "";
    var cardPerSlideCount = 0;
    var layoutContent = "";
    var totalRows = Math.ceil(dllComponentGlobalVariables.totalCardsPerLoad / dllComponentGlobalVariables.itemsPerRow);
    var viewLayoutClass = "";

    if ($(window).width() < 1135 && $(window).width() > 1023) {

        dllComponentGlobalVariables.itemsPerRow = 3;
        totalRows = 1;
        totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / 2);
    }

    if ($(window).width() < 1024 && $(window).width() >= 768) {

        dllComponentGlobalVariables.itemsPerRow = 2;
        totalRows = 1;
        totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / 2);
    }

    if ($(window).width() < 768 && $(window).width() > 600) {

        dllComponentGlobalVariables.itemsPerRow = 2;
        totalRows = 1;
        totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / 2);
    }

    if ($(window).width() < 458) {

        dllComponentGlobalVariables.itemsPerRow = 1;
        totalRows = 1;
        totalSlides = dllComponentGlobalVariables.totalCardsFetched;
    }

    if ((dllComponentGlobalVariables.contentPresentationView === "TitleView") || (dllComponentGlobalVariables.contentPresentationView === "ListView")) {
        dllComponentGlobalVariables.itemsPerRow = dllComponentGlobalVariables.totalCardsPerLoad;
        dllComponentGlobalVariables.masterCardsPerRow = dllComponentGlobalVariables.totalCardsPerLoad;
        totalRows = 1;
        totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / dllComponentGlobalVariables.totalCardsPerLoad);
    }

    if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
        layoutContent += generateTitleViewHeaderLayout(componentID);
    }

    // check if items per row defined by author is lesser than calculated
    if (dllComponentGlobalVariables.totalCardsPerLoad < dllComponentGlobalVariables.itemsPerRow) {
        dllComponentGlobalVariables.itemsPerRow = dllComponentGlobalVariables.totalCardsPerLoad;
        totalSlides = Math.ceil(dllComponentGlobalVariables.totalCardsFetched / dllComponentGlobalVariables.itemsPerRow);
    }

    //Add additional class to wrapper for partial view override
    if (dllComponentGlobalVariables.contentPresentationView === "GridView") {
        viewLayoutClass = "gridLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
        viewLayoutClass = "titleLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "Thumbnail") {
        viewLayoutClass = "thumbnailLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "ListView") {
        viewLayoutClass = "listviewLayout-class";
    }
    if (dllComponentGlobalVariables.contentPresentationView === "Tombstone") {
        viewLayoutClass = "tombstoneLayout-class";
    }

    layoutContent += "<div id='DLL-Carousel-Container' class='dll-container text-center my-" + dllComponentGlobalVariables.itemsPerRow + "' role='region' aria-label='slide show'>";

    layoutContent += "<div class='row mx-auto my-auto'>";
    layoutContent += "<div id='carousel-component-wrapper' class='carousel slide dll-component-wrapper multi-item-carousel  " + viewLayoutClass + "' data-ride='carousel' data-touch='true' data-interval='" + dllComponentGlobalVariables.carouselTimer + "'>";
    layoutContent += "<div class='dll-wrapper-container carousel-inner-container carousel-inner grid-view-nopartial'>";
    // render carousel slide
    var i;
    var j;
    var k;
    for (i = 0; i < totalSlides; i += 1) {

        cardPerSlideCount = 0;
        layoutContent += "<div class='carousel-item " + (i === 0 ? "active" : "") + "' role='group' aria-labelledby='slide-" + i + "'>";
        carouselIndicatorBars += indicatorsBarsMiddleContent(i, componentID);
        // generate slide content based on number of cards per load
        for (j = 0; j < totalRows; j += 1) {

            // generate each grid
            for (k = 0; k < dllComponentGlobalVariables.itemsPerRow; k += 1) {
                if (dllComponentGlobalVariables.contentPresentationView === "GridView") {
                    layoutContent += generateGridCardLayout(dllComponentGlobalVariables);
                }
                if (dllComponentGlobalVariables.contentPresentationView === "TitleView") {
                    layoutContent += generateTitleViewLayout(dllComponentGlobalVariables);
                }
                if (dllComponentGlobalVariables.contentPresentationView === "Thumbnail") {
                    layoutContent += generateThumbnailCardLayout(dllComponentGlobalVariables);
                }
                if (dllComponentGlobalVariables.contentPresentationView === "ListView") {
                    layoutContent += generateListViewCardLayout(dllComponentGlobalVariables);
                }
                if (dllComponentGlobalVariables.contentPresentationView === "Tombstone") {
                    layoutContent += generateTombstoneCardLayout(dllComponentGlobalVariables);
                }
                dllComponentGlobalVariables.cardIndex += 1;
                cardPerSlideCount += 1;
                if (cardPerSlideCount >= dllComponentGlobalVariables.totalCardsPerLoad) {

                    k = dllComponentGlobalVariables.itemsPerRow;
                    j = dllComponentGlobalVariables.totalCardsPerLoad;
                    break;
                }
                if (dllComponentGlobalVariables.cardIndex >= dllComponentGlobalVariables.totalCardsFetched) {
                    k = dllComponentGlobalVariables.itemsPerRow;
                    j = dllComponentGlobalVariables.totalCardsPerLoad;
                    i = totalSlides;
                }
            }
        }

        layoutContent += "</div>";
    }
    layoutContent += "</div>";

    if (totalSlides > 1) {
        layoutContent += '<div class="carousel-indicator-container"><div class="indicator-gutter">' + renderCarouselPrevIndicators(componentID) + '</div><div class="indicator-buttons">' + indicatorsBarsHeadContent() + carouselIndicatorBars + indicatorsBarsTailContent() + '</div><div class="indicator-gutter">' + renderCarouselNextIndicators(componentID) + "</div></div>";
    }
    layoutContent += "</div></div></div>";
    return layoutContent;
}

