(function () {
    const Accordion = $('.accordion');
    if (Accordion.length === 0) {
        return;
    } else {
        accordion_onclick();
        $(".accordion button").click(function () {
            accordion_onclick()
        });
        defaultAccordionTab();

        $("a").each(function getAnchorTagHref() {
            // get href
            hashID = $(this).attr("href");
            if (hashID)
                if (hashID.charAt(0) == "#") {
                    $(this).click(function () {
                        scrollToAccordionPanel($(this).attr("href"));
                    });
                }
        });

        function scrollToAccordionPanel(hrefValue) {
            $("a").each(function getPanelAnchor() {
                if ($(this).attr("id") == hrefValue.substring(1) && $(this).hasClass("accordion-bookmark")) {
                    panelId = $("#accordion-panel-" + hrefValue.substring(1));
                    if (checkCollapseStatus(panelId)) {
                        panelId.click();
                        $('html,body').animate({
                            scrollTop: panelId.offset().top
                        }, 500)
                    }
                    return false;
                }
            });
        }

        function accordion_onclick() {
            // Add minus icon for collapse element which is open by default
            $('div[id^="faq-accordion-"]').find($(".collapse.show")).each(function () {
                $(this).prev(".accordion-card-header").find(".fa").addClass("fa-minus").removeClass("fa-plus");
            });
            // // Toggle plus minus icon on show hide of collapse element
            $('div[id^="faq-accordion-"]').find($(".collapse")).on('show.bs.collapse', function () {
                $(this).prev(".accordion-card-header").find(".fa").removeClass("fa-plus").addClass("fa-minus");
            }).on('hide.bs.collapse', function () {
                $(this).prev(".card-header").find(".fa").removeClass("fa-minus").addClass("fa-plus");
            });
            //Arrow
            $('div[id^="disclaimer-accordion-"]').find($(".collapse.show")).each(function () {
                $(this).prev(".accordion-card-header").find(".fa").addClass("fa-chevron-up").removeClass("fa-chevron-down");
            });
            $('div[id^="disclaimer-accordion-"]').find($(".collapse")).on('show.bs.collapse', function () {
                $(this).prev(".accordion-card-header").find(".fa").removeClass("fa-chevron-down").addClass("fa-chevron-up");
            }).on('hide.bs.collapse', function () {
                $(this).prev(".accordion-card-header").find(".fa").removeClass("fa-chevron-up").addClass("fa-chevron-down");
            });
        }

        function defaultAccordionTab() {
            panelId = $(window.location.hash);
            if ($(panelId).hasClass("accordion-bookmark")) {
                accordion_panelId = $("#accordion-panel-" + panelId.attr("id"));
                if (checkCollapseStatus(accordion_panelId)) {
                    accordion_panelId.click();
                    $('html,body').animate({
                        scrollTop: accordion_panelId.offset().top
                    }, 500)
                }
            }
        }

        function checkCollapseStatus(panelId) {
            var element = panelId;
            if (element.length) {
                if ($(element).attr("aria-expanded") == "false") {
                    return true;
                }
            }
        };

        window.addEventListener("load", accordClass);

        function accordClass() {
            var elemToObserve = $(Accordion).find('.btn');
            elemToObserve.each(function (i, obj) {
                var $div = $(obj);
                var observer = new MutationObserver(function (mutations) {
                    mutations.forEach(function (mutation) {
                        if (mutation.attributeName === "class") {
                            var attributeValue = $(mutation.target).prop(mutation.attributeName);
                            var btnspan = $(obj).children(".accordion-text")
                            var closedtext = btnspan.data("closed-text")
                            var opentext = btnspan.data("open-text");
                            if ($(obj).hasClass("collapsed")) { // accordion closed
                                btnspan.text(closedtext)
                                $(btnspan).removeClass("truist--icon-carat-up")
                                $(btnspan).addClass("truist--icon-carat-down")
                            } else { // accordion open
                                btnspan.text(opentext)
                                $(btnspan).addClass("truist--icon-carat-up")
                                $(btnspan).removeClass("truist--icon-carat-down")
                            }
                        }
                    });
                });
                observer.observe($div[0], {
                    attributes: true
                });
            })
        }
    }
})();

