function generateSectionalNav() {
    "use strict";
    var currentClass;
    var ariaSelectedFlag;
    var sectionNavData = JSON.parse($(".section-navigation").attr("data-src"));
    currentClass = "";
    ariaSelectedFlag = "false";
    if (sectionNavData.current === "true") {
        currentClass = "selected-item";
        ariaSelectedFlag = "true";
    }
    var mainLevelMenu = $("<ul/>", {
            "class": "nav flex-column flex-nowrap"
        })
        .append($("<li/>", {
                "class": "nav-item"
            })
            .append($("<a />", {
                href: sectionNavData.url,
                "class": "nav-link text-truncate " + currentClass,
                "aria-current": "" + ariaSelectedFlag,
                html: "<span>" + sectionNavData.title + "</span>"
            }))
            .append($("<ul/>", {
                id: "targetParent",
                "class": "flex-column nav parent-wrapper"
            })));
    $(".nav-wrapper").append(mainLevelMenu);
    if (sectionNavData.hasOwnProperty("child")) {
        $.each(sectionNavData.child, function (navChildKey, navChildVal) {
            "use strict";
            currentClass = "";
            ariaSelectedFlag = "false";
            if (navChildVal.current === "true") {
                currentClass = "selected-item";
                ariaSelectedFlag = "true";
            }
            var firstLevelMenu = $("<li/>", {
                    id: "child" + navChildKey,
                    "class": "nav-item"
                })
                .append($("<a />", {
                    href: navChildVal.url,
                    "class": "nav-link nav-child " + currentClass,
                    "aria-current": "" + ariaSelectedFlag,
                    html: "<span>" + navChildVal.title + "</span>"
                }))
                .append($("<ul/>", {
                    id: "targetchild" + navChildKey,
                    "class": "flex-column nav child-wrapper"
                }));
            $("#targetParent").append(firstLevelMenu);

            if (navChildVal.hasOwnProperty("child")) {
                $.each(navChildVal.child, function (navGrandChildKey, navGrandChildVal) {
                    currentClass = "";
                    ariaSelectedFlag = "false";
                    if (navGrandChildVal.current === "true") {
                        currentClass = "selected-item";
                        ariaSelectedFlag = "true";
                    }
                    var secondLevelMenu = $("<li/>", {
                            id: "grandChild" + navChildKey + navGrandChildKey,
                            "class": "nav-item"
                        })
                        .append($("<a />", {
                            href: navGrandChildVal.url,
                            text: navGrandChildVal.title,
                            "class": "nav-link nav-grandchild " + currentClass,
                            "aria-current": "" + ariaSelectedFlag
                        }));
                    $("#targetchild" + navChildKey).append(secondLevelMenu);

                });
            }
        });
    }
}

