 $(document).ready(function(){
	 
	 if($('body').hasClass("advisor-individual-page") || $('body').hasClass("advisor-team-page")){
			var path = window.location.pathname;
			var nmlsr = $(".profile-info .profile-heading .nmlsr").text().trim();
			var name = $(".profile-info .profile-name").text().trim();
			var email = $(".profile-info .profile-heading .profile-email").text().trim();
			var phone = $(".profile-info .profile-heading .phone").text().trim();
			var fax = $(".profile-info .profile-heading .fax").text().trim();
			var image = $(".profile-info .profile-media .profile-image").attr("src");
			if($('body').hasClass("advisor-team-page")){
				image = $(".team__image img").attr("src");
			}
			var profile = { 'path': path, 'name':name, 'nmlsr': nmlsr, 'email':email, 'phone':phone, 'image':image };
			localStorage.setItem('profile', JSON.stringify(profile));
			
			$( ".profile-info .apply-now" ).click(function() {
				 applynow(this);
			 });
		}
		
	 function applynow(elem){	 
		 var profile = localStorage.getItem('profile');
		 var target = $(elem).attr("target");
		 profile = JSON.parse(profile)
		 console.log('profile: ', profile);	
		 var params = $(elem).attr("href");	 		 
		 if(profile.email){
			 params += profile.email.replace("@","%40");
		 }
		 if(target == '_blank'){
	         	window.open(params, '_blank');
	     }else{
	         	 window.open(params, '_self');
	     }
	 }
 });





$(document).ready(function () {
    var specialtiesAccordion = function () {
        var _private = {
            COLLAPSIBLE_WRAPPER_CLASS: '.js-tru-collapsible',
            COLLAPSIBLE_TRIGGER_CLASS: '.js-tru-collapsible__trigger',
            COLLAPSIBLE_TARGET_CLASS: '.js-tru-collapsible__target',
            COLLAPSIBLE_ICON_CLASS: '.js-tru-collapsible__icon',
            TARGET_PREFIX: 'js-accordion__target--',
            TRIGGER_PREFIX: 'js-accordion__trigger--',
            EXPANDED_CLASS_NO_DOT: 'is-expanded',
            INITIALLY_EXPANDED_CLASS_NO_DOT: 'is-initially-expanded',
            LISTENING_FOR_CLICK_CLASS_NO_DOT: 'is-listening-for-click',
            cacheDom: function cacheDom() {
                _private.$accordion = $('.js-tru-accordion');
                _private.$section = $('.specialites-item');
                _private.$trigger = $('.js-tru-accordion__trigger');
                _private.$target = $('.js-tru-accordion__target');
                _private.$icon = $('.js-tru-accordion__icon');
            },
            bindEvents: function bindEvents() {
                _private.$trigger.on('click keydown', function (e) {
                    if (e.keyCode === 13 || e.keyCode === 32 || e.type === 'click') {
                        e.preventDefault();

                        _private.toggleTarget($(this));
                    }
                });
            },
         
            toggleTarget: function toggleTarget($thisTrigger) {
                var $thisGroup = $thisTrigger.closest(_private.$section);
                var $thisTarget = $thisGroup.find(_private.$target);
                var $thisIcon = $thisGroup.find(_private.$icon); // If the trigger isn't expanded, collapse all other sections
                $thisTrigger.toggleClass('is-expanded').attr('aria-expanded', function (i, attr) {
                    return attr == 'true' ? 'true' : 'false';
                });
                $thisTarget.slideToggle(350);
                $thisIcon.toggleClass('is-rotated');
            },

            init: function init() {
                _private.cacheDom();
                _private.bindEvents();
            }
        };
        var _public = {
            toggleTarget: _private.toggleTarget,
            init: _private.init
        };
        return _public;
    }();


    // init

    if ($('.specialites-item').length) {
        specialtiesAccordion.init();
    }


});

