        $('.truist-globalnav-header-links').removeClass('js-desktop-loaded-global-navbar') // remove desktop hidden class after moving div
        $('.truist-globalnav-nav-link').removeClass('js-desktop-loaded-global-navbar') // remove desktop hidden class after moving div
        //search box
        $('.truist-globalnav-search-placeholder').parent().addClass('truist-display-menu-none');
        $('.truist-global-nav-menuitem-search-mobile').children().appendTo('.truist-global-nav-menuitem-search-desktop');
